import Layout from '../components/MyLayout';


const Index = () => (
    <div>
        <Layout>
        <h1>It's CRUD time!</h1>
        <div className="flex-large">
          <h2>Add user</h2>
        </div>
        <div className="flex-large">
          <h2>View users</h2>
        </div>
        </Layout>
    </div>
  );

export default Index;
